window.bookSummaryJSON = "<p><b>Bookish and proper Percival Tunstell finds himself out of his depth when floating cities, spirited plumbing, and soggy biscuits collide in this delightful conclusion to </b><b><i>NYT </i></b><b>best-selling author Gail Carriger's Custard Protocol series.</b></p> <p>Percival Tunstell loves that his sister and her best friend are building themselves a family of misfits aboard their airship, the <i>Spotted Custard</i>. Of course, he'd never admit that he belongs among them. He's always been on the outside - dispassionate, aloof, and hatless. But accidental spies, a trip to Japan, and one smart and beautiful doctor may have him renegotiating his whole philosophy on life.</p> <p>Except hats. He's done with hats. Thank you very much.</p> <p><b>Custard Protocol</b></p> <p><i>Prudence</i><br> <i> Imprudence</i><br> <i> Competence</i><br> <i> Reticence</i></p> <p>For more from Gail Carriger, check out:</p> <p><b>Parasol Protectorate</b></p> <p><i>Soulless</i><br> <i> Changeless</i><br> <i> Blameless</i><br> <i> Heartless</i><br> <i> Timeless</i></p>"; 
